import React, { useState, useEffect } from "react";
import axios from "axios";
import InfoItem from "./InfoItem";
import Page404 from "../Page404";
const Info = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/company")
      .then((response) => {
        console.log(response.data);
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
        setError(error.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="container text-light text-start">
       <div class="row">
    <div class="col">
      <h1>About Company </h1>
      <h3> Founder : {data.ceo}</h3>
      <p>Ceo : {data.ceo}</p>
      <p>{data.coo}</p>
      <p>Cto : {data.cto}</p>
      <p>Cto Propulsion : {data.cto_propulsion}</p>
    </div>
    <div class="col-5">
      <h1>Headquarter </h1>
      <h4>Address : {data.headquarters===undefined ? data.headquarters.address : data.headquarters.address}</h4>
      <h4>Sity : {data.headquarters===undefined ? "":data.headquarters.city}</h4>
      <h4>State : {data.headquarters===undefined ? "":data.headquarters.state}</h4>
    </div>
    <div class="col">
      <h1>{data.ceo}</h1>
    </div>
  </div>
</div>
  );
};

export default Info;
